import React from 'react';
import ChevronLeftIcon from '@material-ui/icons/ChevronLeft';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
export default class History extends React.Component{
    constructor(props){
        super(props)
        console.log(props)
    }
    render(){
        return(
        <div style={{marginTop:'64px', width:'100%'}}>
            <Container width='lg' style={{height:'600px', margin:'0px', padding:'0px'}}>
                <Grid container spacing={1} width='lg' style={{height:'inherit'}}>
                    <Grid item lg={1} style={{margin:'auto'}}>a</Grid>
                    <Grid item lg={10} style={{margin:'auto'}}>b</Grid>
                    <Grid item lg={1} style={{margin:'auto'}}>c</Grid>
                </Grid>   
            </Container>             
        </div> 
        )
    }
}
